const percentGraduation = [0, 20, 30, 40, 60, 80, 100]

const Chart = ({data}) => {
//   static demoUrl = 'https://codesandbox.io/s/stacked-bar-chart-s47i2';

    return (
      <ResponsiveContainer width="100%" height="100%">
        <BarChart
          width={500}
          height={300}
          border-radius={80}
          data={data}
          margin={{
            top: 20,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" />
          <YAxis domain={[0, 100 + "%"]} />
          <Tooltip />
          <Legend />
          <Bar dataKey="onTrack" stackId="a" fill="#1A9E68" />
          <Bar dataKey="atRisk" stackId="a" fill="#D52A2A" />
          <Bar dataKey="behind" stackId="a" fill="#E6821D" />
        </BarChart>
      </ResponsiveContainer>
    );
}

export default Chart
